import math
import time


def kClosest(points, k):
    """sorting the list takes too long!"""
    total = 0
    for i, p in enumerate(points):
        start = time.time()
        x, y = p
        dist = (x**2 + y**2)
        p.append(dist)
        j = i
        while j > 0 and points[j-1][2] > points[j][2]:
            temp = points[j-1]
            points[j - 1] = points[j]
            points[j] = temp
            j -= 1
        end = time.time()
        print(round(end-start, 10))
        total += (end-start)
    print(f"avg iteration time: {round(total/(i+1), 5)}")
    final_step = time.time()
    res = [pt[0:2] for pt in points[:k]]
    final_step_end = time.time()
    print(f"last step took: {final_step_end - final_step}")
    total += final_step_end - final_step
    print(round(total, 5))
    return res


